In order for it to serialize json objects properly, the
./data/addressbook.json file must start with
{
    "musicians": [ ...
}
instead of "persons".

In AddressBook.java, one block comment was deleted to pass CI.
The comment is:
The unusual code block below is a non-static initialization block,
sometimes used to avoid duplication between constructors.
Note that non-static init blocks are not recommended to use. There are
other ways to avoid duplication.
{
    musicians = new UniqueMusicianList();
}
